eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (/* export default binding */ __WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n/* harmony default export */ function __WEBPACK_DEFAULT_EXPORT__() {\n    const content = document.querySelector(\"div#content\");\n    if (!content)\n    {\n        throw new Error(\"Content not found\");\n    }\n\n    content.innerHTML = `\n        <div class=\"menu-page\">\n            <h2 class=\"headline\">De Tapas y Sueños: A Taste of Andalusia</h2>\n            <h3>Starters</h3>\n            <ul>\n                <li>\n                    <h4>Gazpacho Andaluz</h4>\n                    <p>A refreshing and vibrant chilled soup made with the finest ripe tomatoes, cucumbers, peppers, and a touch of sherry vinegar.  A true taste of summer in Andalusia.</p>\n                </li>\n                <li>\n                    <h4>Salmorejo Cordobés</h4>\n                    <p>Our take on the classic Cordoban salmorejo.  A thick and creamy tomato and bread soup, made with locally sourced tomatoes, extra virgin olive oil, and a hint of garlic.  Served with a garnish of hard-boiled egg and Iberian ham.</p>\n                </li>\n                <li>\n                    <h4>Gambas al Ajillo</h4>\n                    <p>Succulent, fresh prawns sautéed in extra virgin olive oil, infused with the fragrant aroma of garlic and a touch of chili for a subtle kick.</p>\n                </li>\n                <li>\n                    <h4>Jamón Ibérico de Bellota</h4>\n                    <p>The king of Spanish hams. Thinly sliced, acorn-fed Ibérico ham, aged to perfection, with a melt-in-your-mouth texture and an unparalleled depth of flavor.</p>\n                </li>\n                <li>\n                    <h4>Tortillitas de Camarones</h4>\n                    <p>Delicate and crispy shrimp fritters, a beloved specialty of Cadiz.  Made with tiny, sweet shrimp, chickpea flour, and fresh parsley.</p>\n                </li>\n            </ul>\n\n            <h3>Main Courses</h3>\n            <ul>\n                <li>\n                    <h4>Berza Jerezana</h4>\n                    <p>A hearty and traditional Andalusian stew, a true taste of Jerez.  This comforting dish features a medley of tender chickpeas, white beans, and a variety of local vegetables, slow-cooked with savory pork (pork belly, chorizo, morcilla), and seasoned with fragrant spices.  A rich and flavorful experience.</p>\n                </li>\n                <li>\n                    <h4>Rabo de Toro a la Cordobesa</h4>\n                    <p>A classic Cordoban dish, slow-braised oxtail in a rich and flavorful sauce made with red wine, vegetables, and aromatic spices.  Fall-off-the-bone tender and incredibly satisfying.</p>\n                </li>\n                <li>\n                    <h4>Flamenquín Cordobés</h4>\n                    <p>A Cordoban favorite.  Thinly pounded pork loin, wrapped around slices of Serrano ham and cheese, breaded, and fried to golden perfection.</p>\n                </li>\n                <li>\n                    <h4>Pescaito Frito (Assorted Fried Fish)</h4>\n                    <p>A taste of the Andalusian coast.  A selection of the freshest seasonal fish, lightly battered and fried to crispy perfection. Served with a wedge of lemon.</p>\n                </li>\n                <li>\n                    <h4>Cazón en Adobo</h4>\n                    <p>Marinated dogfish, a traditional Andalusian tapa. Cubes of dogfish are marinated in a flavorful blend of paprika, oregano, garlic, and sherry vinegar, then fried until golden and crispy.</p>\n                </li>\n            </ul>\n\n            <h3>Desserts</h3>\n            <ul>\n                <li>\n                    <h4>Torrijas</h4>\n                    <p>A classic Andalusian treat, especially popular during Semana Santa.  Slices of bread are soaked in milk and wine, infused with cinnamon and lemon zest, then dipped in egg, fried to golden perfection, and drizzled with honey or sprinkled with sugar.</p>\n                </li>\n                <li>\n                    <h4>Pan de Cádiz</h4>\n                    <p>A traditional marzipan confection from Cádiz, often enjoyed during the Christmas season. This sweet treat features layers of colorful candied fruits and yema (sweet egg yolk paste), creating a beautiful and delicious centerpiece.</p>\n                </li>\n                <li>\n                    <h4>Pionono de Santa Fe</h4>\n                    <p>A Granadian delicacy.  Small, cylindrical pastries soaked in a sweet syrup and topped with toasted cream.  A delightful bite-sized treat.</p>\n                </li>\n                <li>\n                    <h4>Arroz con Leche</h4>\n                    <p>Creamy and comforting Spanish rice pudding, infused with the warm flavors of cinnamon and lemon zest.  A classic for a reason.</p>\n                </li>\n                <li>\n                    <h4>Tocino de Cielo</h4>\n                    <p>\"Heavenly Bacon\" - a deceptively named dessert.  An incredibly rich and smooth custard made with egg yolks, sugar, and water, with a hint of lemon.  A truly decadent treat.</p>\n                </li>\n            </ul>\n            <p class=\"allergies\"> * Please inform your server of any allergies or dietary restrictions. </p>\n        </div>\n    `;\n}//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/menu.js\n");

